Guilty as Sin (Split Scenes)

celine devoux, blake mitchell, missy, alex dane

The Jury is still out. Did she do it? If you know Missy, you know she does it every chance she gets; but we don't mean murder! Although she's accused in the very untimely death of her very rich husband, we think the jury may be able to see through the smoke and mirrors. We know you will...

